import React from "react";

const Service =()=>{
      return(
        <>
            <div className=" my-5">
                <h1 className=" tab-content"> Our Services</h1>
            </div>
            <div className=" container-fluid mb-5">
               <div className=" row">
                   <div className=" col-md-4 col-10 mx-auto"></div>
               </div>
            </div>
        </>
      );
};

export default Service;
